import React from "react";
import { useNavigate } from "react-router-dom";

const Profile = () => {
  const user = {
    username: "JohnDoe",
    email: "john.doe@example.com",
    password: "************", // Masked password for security
  };

  const navigate = useNavigate(); // Get the navigate function

  return (
    <div className="flex justify-center items-center min-h-screen bg-gradient-to-r from-indigo-200 via-purple-300 to-pink-400">
      <div className="max-w-lg w-full p-8 bg-white rounded-xl shadow-2xl">
        <div className="text-center mb-6">
          <h1 className="text-4xl font-bold text-gray-800 mb-2">
            User Profile
          </h1>
          <p className="text-lg text-gray-500">
            View and update your details below
          </p>
        </div>

        <div className="space-y-6">
          {/* Username */}
          <div className="flex justify-between items-center p-4 rounded-lg bg-gray-50 shadow-md hover:bg-gray-100 transition duration-300">
            <h2 className="text-xl font-semibold text-gray-800">Username</h2>
            <p className="text-gray-600">{user.username}</p>
          </div>

          {/* Email */}
          <div className="flex justify-between items-center p-4 rounded-lg bg-gray-50 shadow-md hover:bg-gray-100 transition duration-300">
            <h2 className="text-xl font-semibold text-gray-800">Email</h2>
            <p className="text-gray-600">{user.email}</p>
          </div>

          {/* Password */}
          <div className="flex justify-between items-center p-4 rounded-lg bg-gray-50 shadow-md hover:bg-gray-100 transition duration-300">
            <h2 className="text-xl font-semibold text-gray-800">Password</h2>
            <p className="text-gray-600">{user.password}</p>
          </div>
        </div>

        {/* Edit Profile Button */}
        <div className="mt-8">
          <button
            onClick={() => navigate("/editProfile")}
            className="w-full py-3 px-6 bg-gradient-to-r from-blue-500 to-blue-700 text-white font-semibold rounded-lg hover:from-blue-600 hover:to-blue-800 transition duration-300"
          >
            Edit Profile
          </button>
        </div>
      </div>
    </div>
  );
};

export default Profile;
